import { Component, OnInit } from '@angular/core';

@Component({
  selector: 'app-beneficiario-home',
  templateUrl: './beneficiario-home.component.html',
  styleUrls: []
})
export class BeneficiarioHomeComponent implements OnInit {

  constructor() { }

  ngOnInit() {
  }

}
<app-toolbar-navigation></app-toolbar-navigation>

<app-beneficiario-table
  [beneficiario]="beneficiarioDatas"
  (deleteBeneficiarioEvent)="handleDeleteBeneficiarioAction($event)"
  (beneficiarioEvent)="handleBeneficiarioAction($event)"
></app-beneficiario-table>
